import api from './api';


const usersList = {
    registerUser : async (first_name, last_name, email, password)=>{
        return api.post("/signup",{first_name,last_name, email, password})
    },
    loginUser : async(email, password)=>{
        return api.post("/signin")
    }
}



export default usersList;
